import React from "react";
import "./styles.scss";
import { Button } from "@material-ui/core";
import { withStyles } from "@material-ui/core/styles";

const StyledButton = withStyles({
  root: {
    // background:  ,
    height: 48,
    fontFamily: "Montserrat, sans-serif",
  },
})(Button);

export default StyledButton;
